import { Node } from './Node' ;
import { Iterator } from './Iterator' ;

export default class FlipList {

	constructor ( iterable = null ) {
		/**
		 *  head  -> tail
		 *    |        |
		 *  rtail <- rhead
		 */
		this.head = new Node(null);
		this.rtail = new Node(null);
		this.tail = new Node(null);
		this.rhead = new Node(null);
		this.head.sibling = this.rtail;
		this.rtail.sibling = this.head;
		this.rhead.sibling = this.tail;
		this.tail.sibling = this.rhead;
		this.head.next = this.tail;
		this.rhead.next = this.rtail;

		if ( iterable ) for ( const value of iterable ) this.append(value);
	}

	reverse ( ) {
		const head = this.head;
		const tail = this.tail;
		this.head = this.rhead;
		this.tail = this.rtail;
		this.rhead = head;
		this.rtail = tail;
	}

	reversebetween ( itleft , itright ) {

		const left = itleft.node;
		const right = itright.node;

		left.sibling.next.sibling.next = right.sibling.next;
		right.sibling.next.sibling.next = left.sibling.next;
		right.sibling.next = left;
		left.sibling.next = right;

	}

	*[Symbol.iterator] ( ) {
		let node = this.head;
		while (node.next !== this.tail) {
			node = node.next;
			yield node.value;
		}
	}

	prepend ( value ) {

		const forward = new Node(value);
		const backward = new Node(value);

		forward.next = this.head.next;
		backward.next = this.rtail;

		forward.sibling = backward;
		backward.sibling = forward;

		this.head.next = forward;
		forward.next.sibling.next = backward;

	}

	append ( value ) {

		const forward = new Node(value);
		const backward = new Node(value);

		forward.next = this.tail;
		backward.next = this.rhead.next;

		forward.sibling = backward;
		backward.sibling = forward;

		this.rhead.next = backward;
		backward.next.sibling.next = forward;

	}

	extend ( other ) {
		this.rhead.next.sibling.next = other.head.next;
		other.head.next.sibling.next = this.rhead.next;

		this.tail = other.tail;
		this.rhead = other.rhead;
	}

	begin ( ) {
		return new Iterator( this.head.next ) ;
	}

	rbegin ( ) {
		return new Iterator( this.rhead.next ) ;
	}

	end ( ) {
		return new Iterator( this.tail ) ;
	}

	rend ( ) {
		return new Iterator( this.rtail ) ;
	}

}

export class Iterator {

	constructor ( node ) {
		this.node = node;
	}

	next ( ) {
		return new Iterator( this.node.next ) ;
	}

	prev ( ) {
		return new Iterator( this.node.sibling.next.sibling ) ;
	}

	value ( ) {
		return this.node.value ;
	}

	reversed ( ) {
		return new Iterator( this.node.sibling ) ;
	}

	skip ( n ) {

		let node = this.node;

		for ( let i = 0 ; i < n ; ++i ) node = node.next;

		return new Iterator( node ) ;

	}

	rewind ( n ) {

		let node = this.node.sibling;

		for ( let i = 0 ; i < n ; ++i ) node = node.next;

		return new Iterator( node.sibling ) ;

	}

}

export class Node {

	constructor ( value ) {
		this.next = null;
		this.sibling = null;
		this.value = value;
	}

}

import FlipList from './FlipList' ;
import Node from './Node' ;
import Iterator from './Iterator' ;

export default FlipList ;

export {
	FlipList ,
	Node ,
	Iterator ,
} ;

export class Direction {

	constructor ( reversed ) {
		this.reversed = reversed;
	}

}

export class HeadIterator {

	constructor (direction, validity, node, value, done) {
		this.direction = direction;
		this.node = node;
		this.value = value;
		this.done = done;
		this.validity = validity;
	}

	valid () {
		return this.validity.valid;
	}

	next () {
		if (this.direction.reversed) {
			if (this.node.bw === null) {
				return { done : true } ;
			}
			else {
				return new InternalIterator(this.direction, this.previous)
			}
			if (this.node.fw === null) {
				return { done : true } ;
			}
			return new Iterator(this.direction, this.validity, this.node.fw, this.node.value, this.node.fw === null);
		}
		else {
			return new Iterator(this.direction, this.validity, this.node.bw, this.node.value, this.node.bw === null);
		}
	}

}

